export default function App() {
  const Stack = createStackNavigator();
  return (

<NavigationContainer>
    <Stack.Navigator>
    <Stack.Screen name="items" component={Items} />
    <Stack.Screen name="addItems" component={Adding} />
     
     
      
    </Stack.Navigator>
  </NavigationContainer>
    
  );
}

